import PhoneNumberHead from './PhoneNumberHead'
import EmailMid from './EmailMid'

class Email extends Component {
    render() {
        return (
            <div className="wrapper">
                <PhoneNumberHead />
                <EmailMid />
            </div>
        )
    }
}
export default Email
